import React from 'react';

export default function Footer(){
  return (
    <footer className="mt-12 text-center text-sm text-gray-600">
      <p>© {new Date().getFullYear()} Gudipudi Durga Swathi • Built with MERN</p>
      <p>Resume: <a href="/resume.pdf" target="_blank" rel="noreferrer" className="underline">Download</a></p>
    </footer>
  );
}
